import React from 'react';

import logoImg from '../../assets/images/logo.svg';

function Landing(){
    return(
        <div id="page-landing" className="container">
            <div className="logo-container">
                <img src={logoimg} alt=""/>
                </div>           
        </div>

    )
}

export default Landing
